import {Icon} from 'semantic-ui-react';
import './Login.css'

export default class Logout extends Component {

  Handler = (e) => {
    e.preventDefault();
    localStorage.removeItem("id_token")

  }

  render(){





    return(
      <form onSubmit={this.Handler}>
          <Icon  name='user' color='white' size='large'> Logout</Icon>

      </form>
    )


  }




}
